LocaleInfo.ui_metadata_command_config_CompositeCommandConfigEditDialog_executeRuleScriptHint = "複合Commandを利用する場合の処理ルールをGroovyScriptで設定します。<br>ルールでは、複数のCommandの呼び出し順などを制御可能で、最終的にCommandの実行結果文字列を返却するように実装します。<br>あらかじめ変数のcmdにCommandのインスタンスが配列でバインドされています。<br>また、変数requestにRequestContextがバインドされています。<br>設定例:<pre>if (cmd[0].execute(request) == \"SUCCESS\") {\r\n    return cmd[1].execute(request);\r\n} else {\r\n    return cmd[2].execute(request);\r\n}\r\n</pre>ルールが未指定の場合は、リストに指定された順番でCommandを実行し、最後のCommandの実行結果がCommandの実行結果として返却されます。";
