LocaleInfo.generic_common_WebApiAutocompletionSetting_eqlDisplaNameKey = "EQL";
LocaleInfo.generic_common_WebApiAutocompletionSetting_eqlDescriptionKey = "自動補完タイプでEQLを選択した際に実行する処理です。<br>GroovyTemplate形式で記述してください。<br><br>対象の項目がReference型の場合、Entityの配列を返却します。<br>EQLにはoidとnameを必ず指定してください。「表示ラベルとして扱うプロパティ」を設定した場合、nameの代わりにそのプロパティを指定してください。「ユニークキープロパティ」を設定した場合、そのプロパティを指定してください。<br><br>Reference型以外の場合、最初のSelect項目を補完の値として利用します。<br><br>利用可能な変数は以下の名前でバインドされています。<br><br>user\t: UserBinding・・・ユーザ情報<br>params\t: Map<String, String[]>・・・連動元のプロパティの値<br>currentValue\t: String, List<String>・・・連動先のプロパティの値(多重度が複数の場合、連動先のプロパティの値のリスト)<br>paramsおよび、currentValueはEQLエスケープ済みです。LIKE文に利用する場合は、明示的にLike文用エスケープ処理を記述する必要があります。<br><br>自動補完が可能な型と返却値の型は以下の通りです。<br>Binary型\t: String(検索条件のみ)<br>Boolean型\t: boolean, String(true/false)<br>Date型\t: Date, String(yyyyMMdd)<br>Datetime型\t: Timestamp, String(yyyyMMddhhmmssSSS)<br>Decimal型\t: Bigdecimal, String<br>Float型\t: Double, String<br>Integer型\t: Long, String<br>LongText型\t: String<br>Reference型\t: Entity(oid, nameは必須)<br>Select型\t: SelectValue, String(value値)<br>String型\t: String<br>Time型\t: Time, String(hhmmssSSS)";
LocaleInfo.generic_common_WebApiAutocompletionSetting_groovyscriptDisplaNameKey = "Groovyscript";
LocaleInfo.generic_common_WebApiAutocompletionSetting_groovyscriptDescriptionKey = "自動補完タイプでGROOVYSCRIPTを選択した際に実行する処理です。<br>GroovyScript形式で記述してください。<br><br>利用可能な変数は以下の名前でバインドされています。<br><br>user\t: UserBinding・・・ユーザ情報<br>params\t: Map<String, String[]>・・・連動元のプロパティの値<br>currentValue\t: String, List<String>・・・連動先のプロパティの値(多重度が複数の場合、連動先のプロパティの値のリスト)<br><br>自動補完が可能な型と返却値の型は以下の通りです。<br>多重度が2以上の場合や範囲検索が可能な場合、<br>Binary型\t: String(検索条件のみ)<br>Boolean型\t: boolean, String(true/false)<br>Date型\t: Date, String(yyyyMMdd)<br>Datetime型\t: Timestamp, String(yyyyMMddhhmmssSSS)<br>Decimal型\t: Bigdecimal, String<br>Float型\t: Double, String<br>Integer型\t: Long, String<br>LongText型\t: String<br>Reference型\t: Entity(oid, nameは必須)<br>Select型\t: SelectValue, String(value値)<br>String型\t: String<br>Time型\t: Time, String(hhmmssSSS)";
LocaleInfo.generic_editor_PropertyEditor_customStyleDisplayNameKey = "表示カスタムスタイル";
LocaleInfo.generic_editor_PropertyEditor_customStyleDescriptionKey = "データ表示時のhtml要素スタイルをカスタマイズします。<br/>SearchLayoutの検索条件、SearchLayoutの検索結果、DetailLayoutの詳細画面での出力スタイルに適用されます。";
LocaleInfo.generic_editor_PropertyEditor_customStyleDescriptionKeyScriptHint = "<p>データ表示時のhtml要素スタイルをカスタマイズします。<br/>SearchLayoutの検索条件、SearchLayoutの検索結果、DetailLayoutの詳細画面での出力スタイルに適用されます。</p><p>GroovyTemplate形式で指定します。</p><br/><br/><p>Base Variable</p><ul><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li></ul><p>Specific Variable</p><ul><li>today : Current date. Instance of java.sql.Timestamp.</li><li>entity : Target entity data.<br/>When DetailLayout(insert mode), [entity] is null.</li><li>value : Target property data.<br/>When DetailLayout(insert mode), [value] is null.</li></ul>";
