LocaleInfo.generic_editor_PropertyEditor_inputCustomStyleDescriptionKeyScriptHint = "<p>データ入力時のinput要素スタイルをカスタマイズします。<br/>SearchLayoutの検索条件、DetailLayoutの編集画面での入力スタイルに適用されます。</p><p>GroovyTemplate形式で指定します。</p><br/><br/><p>Base Variable</p><ul><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li></ul><p>Specific Variable</p><ul><li>today : Current date. Instance of java.sql.Timestamp.</li><li>entity : Target entity data.<br/>When SearchLayout or DetailLayout(insert mode), [entity] is null.</li><li>value : Target property data.<br/>When Condition parts of SearchLayout or DetailLayout(insert mode), [value] is null.</li></ul>";
